    @SuppressLint({"StaticFieldLeak"})
    public void Update() {
        new AsyncTask<Void, Void, Void>() {

            private String newestMsg = "";
            private String currentMsg = "";
            private boolean network;

            protected void onPreExecute()
            {
                network = isNetworkAvailable();
            }

            protected Void doInBackground(Void... voids)
            {
                if (network)

                {
                    RequestQueue req = Volley.newRequestQueue(MainActivity.this);

                    JsonObjectRequest jsObjRequest = new JsonObjectRequest(Request.Method.GET, Constants.NOTIF_URL, null, new Response.Listener<JSONObject>()
                    {

                        public void onResponse(JSONObject response)
                        {

                            try
                            {

                                newestMsg = response.getJSONObject("update").getString("newestMsg");
                                currentMsg = response.getJSONObject("update").getString(newestMsg);

                                String encKey = AccountActivity.JbroFormat(Constants.PASSWORD, newestMsg);

                                if (!(Prefs.with(MainActivity.this).contains(encKey)) || !(Prefs.with(MainActivity.this).readInt(encKey) == 1))
                                {
                                    Prefs.with(MainActivity.this).writeInt(encKey, 1);
                                    builder = new AlertDialog.Builder(MainActivity.this);
                                    builder.setTitle("New Message From Jbro.")
                                            .setCancelable(false)
                                            .setMessage(currentMsg)
                                            .setPositiveButton("Ok", new DialogInterface.OnClickListener() {
                                                @Override
                                                public void onClick(DialogInterface dialog, int which)
                                                {
                                                    dialog.dismiss();
                                                }
                                            });

                                    alertDialog = builder.create();

                                    alertDialog.show();
                                }
                            }
                            catch (JSONException e)
                            {
                                Log.d("JbroMain: ", e.getMessage());
                                e.printStackTrace();
                            } catch (GeneralSecurityException e) {
                                e.printStackTrace();
                            }
                        }
                    }, new Response.ErrorListener() {
                        @Override
                        public void onErrorResponse(VolleyError error) {
                            Log.e(Constants.TAG, "Notification Request Error: " + error.getMessage());
                        }
                    });
                    req.add(jsObjRequest);
                }
                else if (!network)
                {
                    MainActivity.this.runOnUiThread(new Runnable() {
                        public void run()
                        {
                            Toast.makeText(getBaseContext(), "Please Connect To The Internet", Toast.LENGTH_LONG).show();
                        }
                    });
                }
                return null;
            }

            protected void onPostExecute(Void aVoid) {
                super.onPostExecute(aVoid);

            }
        }.execute();
    }

    public static void copyfile(File src, File dst) throws IOException {
        InputStream in = new FileInputStream(src);
        try {
            OutputStream out = new FileOutputStream(dst);
            try {
                // Transfer bytes from in to out
                byte[] buf = new byte[1024];
                int len;
                while ((len = in.read(buf)) > 0) {
                    out.write(buf, 0, len);
                }
            } finally {
                out.close();
            }
        } finally {
            in.close();
        }
    }
